    const { currUser } = useContext(CommerceContext)
    console.log(currUser)
    return (
        <ProtectedRoute>
            <div className='w-[90%] p-5 mx-auto'>
                <div className='w-[50%] mx-auto bg-slate-200 rounded-lg shadow-2xl text-center p-10'>
                    <h1 className='text-lg font-bold text-blue-400'>Welcome!!! You want this application or any other kind? <a href="https://emnjtech.github.io">Talk to the Developer</a></h1>
                </div>
            </div>
        </ProtectedRoute>
    )
}
